import './App.css';

import React from "react";
import { BrowserRouter, Redirect, Route, Switch } from "react-router-dom";
// import Header from './components/Header/Header'; //Header 컴포넌트 임포트
// import LeftArea from './components/Header/Contents/LeftArea/LeftArea'; //LeftArea 컴포넌트 임포트
import * as P from "../../client/pages/index";
const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" component={P.mainPage} />
        <Route path="/Rulepage" component={P.Rulepage} />
        <Redirect path="*" to="/" />
      </Switch>
  </BrowserRouter>
  );
};

export default App;
